import React from 'react'
import Item from "./Item"
import Header from "./Header"
import todosData from "./toDos"


class App extends React.Component{

    constructor(){
        super()
        this.state = {
            todos : todosData
        }
    }

    render(){
        let todos = this.state.todos.map(function(element){
            return <Item key = {element.id} name = {element.text} checked = {element.completed}/>
        });

        return (
            <div>
                <Header/>
                {todos}
            </div>

        );
    }
}

export default App;
